import styled from 'styled-components'

let Container = styled.div`
  font-family: 'Work Sans';

  a {
    text-decoration: none;
    color: black;
    font-size: 1rem;
    line-height: 2rem;
    font-weight: 300;
  }
`

const Post = ({post}) => <Container>
  <div>
    {post.emotions_description}
  </div>
  <div>
    {post.event_description}
  </div>
{Object.entries(post.emotions).sort(([_, rank]) => rank).map(([emotion, rank]) => <div>`${emotion} ${rank}`</div>)}
</Container>

export default Post
